// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

contract Voting {
    enum ElectionStatus { Setup, Open, Closed, Finalized }

    struct Candidate {
        uint id;
        string name;
        string seat;
        uint voteCount;
        bool isActive;
        string nameHash; // Hash of candidate name for verification
    }

    struct Election {
        uint id;
        string title;
        string description;
        uint startsAt;
        uint endsAt;
        uint[] candidateIds;
        mapping(uint => Candidate) candidates;
        mapping(address => bool) hasVoted; // per-election voter record
        mapping(address => bool) registeredVoters; // registered voters for this election
        uint candidatesCount;
        bool exists;
        ElectionStatus status;
        bool candidateListLocked;
        bool votingEnabled;
        uint totalVotes;
        string finalResultsHash; // Hash of final results for verification
    }

    mapping(uint => Election) private elections;
    uint public electionsCount;
    address public owner;
    uint public version = 2; // contract version

    event ElectionCreated(uint indexed electionId, string title);
    event CandidateAdded(uint indexed electionId, uint indexed candidateId, string name, string seat);
    event VoteCast(uint indexed electionId, uint indexed candidateId, address indexed voter);
    event VoterRegistered(uint indexed electionId, address indexed voter);
    event ElectionStatusChanged(uint indexed electionId, ElectionStatus oldStatus, ElectionStatus newStatus);
    event CandidateListLocked(uint indexed electionId);
    event VotingToggled(uint indexed electionId, bool enabled);
    event TallyFinalized(uint indexed electionId, string resultsHash);

    modifier onlyOwner() {
        require(msg.sender == owner, "Not authorized");
        _;
    }

    modifier electionExists(uint _electionId) {
        require(elections[_electionId].exists, "Election not found");
        _;
    }

    modifier onlyRegisteredVoter(uint _electionId) {
        require(elections[_electionId].registeredVoters[msg.sender], "Voter not registered");
        _;
    }

    constructor() {
        owner = msg.sender;
    }

    // F.1.1: Create & Configure Election
    function createElection(string memory _title, string memory _description, uint _startsAt, uint _endsAt) public onlyOwner returns (uint) {
        electionsCount++;
        Election storage e = elections[electionsCount];
        e.id = electionsCount;
        e.title = _title;
        e.description = _description;
        e.startsAt = _startsAt;
        e.endsAt = _endsAt;
        e.exists = true;
        e.status = ElectionStatus.Setup;
        e.votingEnabled = false;
        e.candidateListLocked = false;
        emit ElectionCreated(electionsCount, _title);
        return electionsCount;
    }

    // F.1.2: Election Lifecycle Control
    function changeElectionStatus(uint _electionId, ElectionStatus _newStatus) public onlyOwner electionExists(_electionId) {
        Election storage e = elections[_electionId];
        ElectionStatus oldStatus = e.status;
        e.status = _newStatus;

        // Auto-enable/disable voting based on status
        if (_newStatus == ElectionStatus.Open) {
            e.votingEnabled = true;
        } else if (_newStatus == ElectionStatus.Closed || _newStatus == ElectionStatus.Finalized) {
            e.votingEnabled = false;
        }

        emit ElectionStatusChanged(_electionId, oldStatus, _newStatus);
    }

    // F.1.2: Toggle Voting (alternative to status change)
    function toggleVoting(uint _electionId, bool _enabled) public onlyOwner electionExists(_electionId) {
        Election storage e = elections[_electionId];
        e.votingEnabled = _enabled;
        emit VotingToggled(_electionId, _enabled);
    }

    // F.2.1: Register Voter
    function registerVoter(uint _electionId, address _voter) public onlyOwner electionExists(_electionId) {
        Election storage e = elections[_electionId];
        require(!e.registeredVoters[_voter], "Voter already registered");
        e.registeredVoters[_voter] = true;
        emit VoterRegistered(_electionId, _voter);
    }

    // F.2.1: Bulk Register Voters
    function registerVoters(uint _electionId, address[] memory _voters) public onlyOwner electionExists(_electionId) {
        Election storage e = elections[_electionId];
        for (uint i = 0; i < _voters.length; i++) {
            if (!e.registeredVoters[_voters[i]]) {
                e.registeredVoters[_voters[i]] = true;
                emit VoterRegistered(_electionId, _voters[i]);
            }
        }
    }

    // F.3.1: Add Candidate with Hash
    function addCandidate(uint _electionId, string memory _name, string memory _seat, string memory _nameHash) public onlyOwner electionExists(_electionId) {
        Election storage e = elections[_electionId];
        require(!e.candidateListLocked, "Candidate list is locked");
        e.candidatesCount++;
        uint cid = e.candidatesCount;
        e.candidates[cid] = Candidate(cid, _name, _seat, 0, true, _nameHash);
        e.candidateIds.push(cid);
        emit CandidateAdded(_electionId, cid, _name, _seat);
    }

    // F.3.2: Lock Candidate List
    function lockCandidateList(uint _electionId) public onlyOwner electionExists(_electionId) {
        Election storage e = elections[_electionId];
        e.candidateListLocked = true;
        emit CandidateListLocked(_electionId);
    }

    // F.4.1: Cast Vote (Enhanced)
    function castVote(uint _electionId, uint _candidateId) public electionExists(_electionId) onlyRegisteredVoter(_electionId) {
        Election storage e = elections[_electionId];
        require(e.votingEnabled, "Voting is not enabled");
        require(!e.hasVoted[msg.sender], "Already voted in this election");
        require(_candidateId > 0 && _candidateId <= e.candidatesCount, "Invalid candidate");
        require(e.candidates[_candidateId].isActive, "Candidate is not active");
        require(block.timestamp >= e.startsAt, "Election has not started");
        require(block.timestamp <= e.endsAt, "Election has ended");

        e.hasVoted[msg.sender] = true;
        e.candidates[_candidateId].voteCount++;
        e.totalVotes++;
        emit VoteCast(_electionId, _candidateId, msg.sender);
    }

    // F.5.1: Finalize Tally
    function finalizeTally(uint _electionId, string memory _resultsHash) public onlyOwner electionExists(_electionId) {
        Election storage e = elections[_electionId];
        require(e.status == ElectionStatus.Closed, "Election must be closed to finalize");
        require(block.timestamp > e.endsAt, "Election has not ended yet");

        e.status = ElectionStatus.Finalized;
        e.finalResultsHash = _resultsHash;
        emit TallyFinalized(_electionId, _resultsHash);
    }

    // Enhanced getters
    function getElection(uint _electionId) public view returns (uint id, string memory title, string memory description, uint startsAt, uint endsAt, uint[] memory candidateIds) {
        require(elections[_electionId].exists, "Election not found");
        Election storage e = elections[_electionId];
        return (e.id, e.title, e.description, e.startsAt, e.endsAt, e.candidateIds);
    }

    // Return detailed election including candidate names, seats and vote counts
    function getElectionDetails(uint _electionId) public view returns (
        uint id,
        string memory title,
        string memory description,
        uint startsAt,
        uint endsAt,
        uint[] memory candidateIds,
        string[] memory names,
        string[] memory seats,
        uint[] memory voteCounts
    ) {
        require(elections[_electionId].exists, "Election not found");
        Election storage e = elections[_electionId];
        uint len = e.candidateIds.length;
        names = new string[](len);
        seats = new string[](len);
        voteCounts = new uint[](len);
        for (uint i = 0; i < len; i++) {
            uint cid = e.candidateIds[i];
            Candidate storage c = e.candidates[cid];
            names[i] = c.name;
            seats[i] = c.seat;
            voteCounts[i] = c.voteCount;
        }
        return (e.id, e.title, e.description, e.startsAt, e.endsAt, e.candidateIds, names, seats, voteCounts);
    }

    function getCandidate(uint _electionId, uint _candidateId) public view returns (uint id, string memory name, uint voteCount) {
        require(elections[_electionId].exists, "Election not found");
        Election storage e = elections[_electionId];
        Candidate storage c = e.candidates[_candidateId];
        return (c.id, c.name, c.voteCount);
    }

    function hasVotedIn(uint _electionId, address _voter) public view returns (bool) {
        require(elections[_electionId].exists, "Election not found");
        return elections[_electionId].hasVoted[_voter];
    }

    // F.2.3: Check if voter is registered
    function isVoterRegistered(uint _electionId, address _voter) public view returns (bool) {
        require(elections[_electionId].exists, "Election not found");
        return elections[_electionId].registeredVoters[_voter];
    }

    // F.5.2: Get turnout statistics
    function getTurnoutStats(uint _electionId) public view returns (uint totalVotes, uint registeredVoters) {
        require(elections[_electionId].exists, "Election not found");
        Election storage e = elections[_electionId];
        return (e.totalVotes, e.candidateIds.length); // Note: This is a simplified version
    }

    // F.5.3: Get final results
    function getFinalResults(uint _electionId) public view returns (string memory resultsHash, bool isFinalized) {
        require(elections[_electionId].exists, "Election not found");
        Election storage e = elections[_electionId];
        return (e.finalResultsHash, e.status == ElectionStatus.Finalized);
    }

    // Get election status
    function getElectionStatus(uint _electionId) public view returns (ElectionStatus status, bool votingEnabled, bool candidateListLocked) {
        require(elections[_electionId].exists, "Election not found");
        Election storage e = elections[_electionId];
        return (e.status, e.votingEnabled, e.candidateListLocked);
    }

    // Get total registered voters count (approximate)
    function getRegisteredVotersCount(uint _electionId) public view returns (uint) {
        require(elections[_electionId].exists, "Election not found");
        // Note: This is a simplified implementation. In a real scenario, you'd need to track this separately
        return elections[_electionId].candidateIds.length;
    }
}
